import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/navbar';
import Hero from './components/hero';
import About from './components/about';
import Services from './components/services';
import Testimonials from './components/testimonials';
import PropertyListing from './components/propertylisting';
import Team from './components/team';
import Blog from './components/blog';
import FindAgent from './components/findagent';
import Contact from './components/contact';
import ParallaxSection from './components/parallaxsection';
import Footer from './components/footer';
import SignUpFormModal from './components/signupformmodal'; // Import the signup modal
import LoginFormModal from './components/loginformmodal';   // Import the login modal
import './index.css';

function App() {
  const [isSignUpVisible, setSignUpVisible] = useState(false); // State for signup form
  const [isLoginVisible, setLoginVisible] = useState(false);   // State for login form

  // Handlers to open and close the signup form
  const handleRegisterClick = () => {
    setSignUpVisible(true);
    setLoginVisible(false); // Close login form if it's open
  };

  const handleCloseSignUpForm = () => {
    setSignUpVisible(false);
  };

  // Handlers to open and close the login form
  const handleLoginClick = () => {
    setLoginVisible(true);
    setSignUpVisible(false); // Close signup form if it's open
  };

  const handleCloseLoginForm = () => {
    setLoginVisible(false);
  };

  return (
    <Router>
      <div className="App">
        {/* Pass the register and login click handlers to Navbar */}
        <Navbar onRegisterClick={handleRegisterClick} onLoginClick={handleLoginClick} />

        {/* Define your routes here */}
        <Routes>
          <Route path="/signup" element={<Hero />} />
          <Route path="/about" element={<About />} />
          <Route path="/services" element={<Services />} />
          <Route path="/testimonials" element={<Testimonials />} />
          <Route path="/properties" element={<PropertyListing />} />
          <Route path="/team" element={<Team />} />
          <Route path="/blog" element={<Blog />} />
          <Route path="/find-agent" element={<FindAgent />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/hero" element={<Hero />} /> {/* Make sure the hero page is accessible */}
        </Routes>

        {/* Render the signup form modal when it's visible */}
        {isSignUpVisible && <SignUpFormModal onClose={handleCloseSignUpForm} />}
        
        {/* Render the login form modal when it's visible */}
        {isLoginVisible && <LoginFormModal onClose={handleCloseLoginForm} />}

        {/* Static components */}
        <ParallaxSection />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
